import Layout from "../components/layout";

const About = () => (
  <Layout>
    <article className="container-fluid">
      <section className="row">
        <div className="col-lg-6 col-sm-12">
          <img src="/photo.png" className="img-fluid"></img>
        </div>
        <div className="col-lg-6">
          <ul>
            <li>
              TED University
              <ul><li>sadsa</li></ul>
            </li>
          </ul>
          <p className="text-left" id="about-text">
            I am currently studying Computer Engineering as a main, and
            Psychology as a secondary field at TED University. I am in third
            grade. I believe that not wasting time and producing solutions to
            real problems are the keys to the success.
          </p>
        </div>
      </section>
    </article>
    <style jsx>{`
      li {
        color: white;
      }
      #about-text {
        color: white;
      }
    `}</style>
  </Layout>
);

export default About;
